(6524, 145, 'Visita Fortalecedora', 'Victor Labra Huallpa', 'Jr Ancash S/N - Puerto Maldonado', '2017-06-12', '11:02:11', '973276132', 'Visitación según cronograma a las familias de la iglesia Nuevo Amanecer. Aquí visitamos a nuestro hermano Victor Labra quien hace mucho tiempo ya no viene a la iglesia, solo su esposa e hijas.', 5),
(6525, 145, 'Visita Instructiva', 'Alex Asto Huaman', 'Psje Jose Carlos Mareategui Mz. C-3', '2017-06-12', '11:04:02', 'No', 'Visitamos a nuestro hermano Alex, quien tomó la decisión de arreglar su situación conyugal y casarse el 5 de julio.', 4),
(6526, 145, 'Visita Fortalecedora', 'Melquiades Asto / Felicitas Huaman', 'Psje Jose Carlos Mareategui - S/N', '2017-06-12', '11:06:41', 'No', 'Visitación a nuestro hermano Melquiades y motivamos en sus actividades, familia y en su fe.', 3),
(6527, 145, 'Visita Fortalecedora', 'Margarita Quispe Quispe', 'Puerto Pastora S/N', '2017-06-12', '11:10:37', 'No', 'Visitación a nuestra hermana margarita para animar su fe. Recibimos un lindo presente de la hermana.', 1),
(6528, 145, 'Visita Fortalecedora', 'Luz Luque Flores', 'Lambayeque Nº 275', '2017-06-12', '11:17:44', 'No', 'Visitación a la hermana Luz para aconsejar en la situación familiar que viene atravesando.', 1),
(6529, 145, 'Visita Fortalecedora', 'Martha Da Silva Pereira', 'Federico Suarez K-13 - Samaria - Puerto Maldo', '2017-06-12', '11:40:08', '082-632020', 'Visita a la hermana Martha y a su familia para fortalecerlos en la fe y la palabra, ya que su asistencia era irregular los sábados.', 5),
(6530, 145, 'Visita Fortalecedora', 'Miriam Miranda Martinez', 'Federico Suarez K-11 - Samaria - Puerto Maldo', '2017-06-12', '11:44:33', '944205388', 'Visita a la hermana Miriam y a sus hijas para fortalecer y animar su fe, estuvieron presentes sus hijas en la visita, ellas no estaban asistiendo fielmente los sábados. También estuvo presente su inquilina.', 4),
(6531, 145, 'Visita Fortalecedora', 'Reina Huaman Tillca', 'Jr. Sinchi Roca - Lt 22', '2017-06-12', '11:49:02', '972473653', 'Vista a nuestra hermana reina y a nuestro hermano Felipe Areque para fortalecer la fe de ellos, recién tienen 3 años de casados. Estuvo también acompañando su vecino juntamente con su esposa.', 5),
(6532, 145, 'Visita Fortalecedora', 'Carlos Farfan Flores', 'Calle Mercurio A-11', '2017-06-12', '11:51:26', '944213304', 'Visitando a nuestro primer anciano y a su familia, evaluamos la vida espiritual de cada integrante y compartimos algunos consejos para mejorar cada día. Carlos, Juana, Sandra, Miriam y Brayan', 5),
(6533, 145, 'Visita Fortalecedora', 'Leoncio Huamanhuallpa Gutierrez', 'Calle Maria Arguedas Lt 10-11', '2017-06-12', '11:53:52', 'No', 'Visitamos a nuestro hermano Leoncio y a su hijo Saul, dialogamos, escuchamos sus experiencias y estudiamos la Biblia con ellos.', 2),
(6534, 145, 'Visita Instructiva', 'Elizabeth Soncco Huaman', 'Calle Sinchi Roca con Tornillos Lt 2', '2017-06-12', '11:55:59', '983837150', 'Visita a nuestros amigos, quienes fueron contactados por una familia adventista para iniciar a estudiar la Biblia.', 2),
(6535, 145, 'Visita Fortalecedora', 'Claudia Guzmán Loayza', 'Calle Manu Nº 491', '2017-06-12', '11:58:52', 'No', 'Visitamos a nuestra hermana Claudia y a su esposo nuestro hermano Leonardo, quien no está yendo a la iglesia. Motivamos su regreso a la iglesia y animamos la fe de ellos y su fidelidad por todas las bendiciones que recibieron hasta aquí.', 2),
(6536, 145, 'Visita Fortalecedora', 'Fidel Mamani Espinoza', 'Av. 15 de Agosto C-2', '2017-06-12', '12:02:18', '958956813', 'Visitamos todo un domingo de tarde a nuestro hermano Fidel y su familia, escuchamos sus experiencias, oramos por ellos y hubo un lindo compartir al almuerzo y a la cena (humitas)', 3),
(6537, 145, 'Visita Fortalecedora', 'Olmer Vargas Calisaya', 'Esquina de la plaza del Triunfo', '2017-06-12', '12:04:27', '982706272', 'Visitamos a nuestro hermano Olmer, quien recientemente sufrió un accidente en su moto, luego de salir un miércoles de hacer deporte. Conversamos, estudiamos, oramos y animamos a nuestro hermano. Dejamos un presente para el.', 1),
(6538, 145, 'Visita Fortalecedora', 'Gabino Saire Quispe', 'Penal de Puerto Maldonado', '2017-06-12', '12:07:36', 'No', 'Dedicamos el sábado para visitar a nuestros hermanos de la cárcel. En especial conocer y escuchar a nuestro hermano Gabino y el paseo que tuvimos por su taller allí adentro.', 1),
(6539, 145, 'Visita Fortalecedora', 'Eugenio Mendoza Espinoza', 'Penal del Puerto Maldonado', '2017-06-12', '12:09:16', 'No', 'Fue una alegría verlo fiel asistiendo los sábados al grupo en la cárcel, escuchar que anhela casarse con su esposa y bautizarse.', 1),
(6540, 145, 'Visita Instructiva', 'Luis Ramos Iman', 'Penal de Puerto Maldonado', '2017-06-12', '12:11:16', 'No', 'El es el líder de la iglesia en la cárcel, verlo a él es una inspiración, aun estando privado de mucha cosas allí en la cárcel, el aceptó el desafío de liderar la iglesia. Conversamos con el, animamos su fe y esperamos vernos otra vez.', 1),
(6541, 145, 'Visita Fortalecedora', 'Martin Mamani Torres', 'Penal de Puerto Maldonado', '2017-06-12', '12:12:59', 'No', 'Aun no está bautizado, pronto lo hará. Ayudaremos con sus tramites de matrimonio para que se case y bautice. Esta feliz de haber conocido la iglesia.', 1),
(6542, 145, 'Visita Fortalecedora', 'Daniel Calla Gonzalo', 'Penal de Puerto Maldonado', '2017-06-12', '12:15:16', 'No', 'Lo encontramos en una carpintería, fue el quien nos ayudó a encontrar a la iglesia en la carcel, es líder de Escuela Sabática y se siente feliz de recibir la visita de un pastor luego de muchos años.', 1),
(6543, 145, 'Visita Fortalecedora', 'Nicasio Hancco Portugal', 'Penal de Puerto Maldondo', '2017-06-12', '12:19:23', 'No', 'Hace poco acabó de bautizarse, y está muy feliz de que le hayamos visitado. Oremos por él y su familia.', 1),
(6544, 145, 'Visita Fortalecedora', 'Severiano Jove Cari', 'Penal de Puerto Maldonado', '2017-06-12', '12:20:34', 'No', 'Es docente de profesión y ha pedido ser bautizado, siempre en cuando no sea un programa improvisado. Oramos por el y su familia.', 1),
